import React from 'react';


import {
    Container
   } from 'reactstrap';

const SlideThird  = () => {

  return (
    <div className="SlideThird">

        <Container>
            <h1>Third Slide</h1>
        </Container>
    </div>
  );
}

export default SlideThird ;
